import React from 'react';
import { Pub } from './assets/HelperComponents';

function Publications() {
  return (
    <div className="">
      <div className="pub-wrapper">
        <h5>Conference and Journal Papers</h5>
        <strong>Investigating How Users in the United States Encounter and Deal With Misinformation on WhatsApp During COVID-19</strong><br/>
        <span>Oishee Chakrabarti*, <u>K. J. Kevin Feng</u>*, Kejing Li*, Kevin Song*, Marshini Chetty</span><br/>
        <i>In submission</i>
      </div>

      <div className="pub-wrapper">
        <h5 style={{marginTop: "1rem"}}>Non-refereed Papers</h5>
          <Pub
            title="Investigating How Users in the United States Encounter and Deal With Misinformation on WhatsApp During COVID-19"
            authors="Oishee Chakrabarti*, K. J. Kevin Feng*, Kejing Li*, Kevin Song*, Marshini Chetty"
            venue="In submission"
          />


        <strong>Saving the Sonorine: Photo-Based Audio Recovery With Photometric Stereo</strong><br/>
      <span><u>K. J. Kevin Feng</u>, Adam Finkelstein</span><br/>
        <i>Princeton CS Junior Research Project</i>
      </div>

      {/*<img src={ require('./assets/img/construction.gif').default } style={{maxWidth: 500}}/>*/}

    </div>
  );
}

export default Publications;
